import React from "react";
import styled from "styled-components";

const Container = styled.div`
    border: 1px solid;
    padding: 25px;
    background-color: red;
`


function CardPequeno(props) {
    return (
        <Container>
            <img src={props.imagem} />
            <p>{props.titulo}</p>
        </Container>
    )
}

export default CardPequeno;
